using System;
using System.IO;
using System.Text;
using System.IO.Compression;

class X
{
    static string c = "";

    static public void Main(String[] args)
    {
        var x = Convert.FromBase64String(c);
        using (var y = new GZipStream(new MemoryStream(x), CompressionMode.Decompress))
        {
            var z = new MemoryStream();
            y.CopyTo(z);
            Console.WriteLine(Encoding.UTF8.GetString(z.ToArray()));
        }
    }
}
